			);
			runOnlyForDeploymentPostprocessing = 0;
			shellPath = /bin/sh;
			shellScript = "# make a directory to hold the stuff we're going to package up\nmkdir -p build/devel-extras-tmp\nmkdir -p build/devel-extras-tmp/Documentation\nmkdir -p build/devel-extras-tmp/SDLMain\nmkdir -p build/devel-extras-tmp/SDLMain/NIBless\nmkdir -p build/devel-extras-tmp/SDLMain/CocoaMenus\nmkdir -p build/devel-extras-tmp/SDLMain/CustomView\n\n# copy the docs\ncp ../../docs.html build/devel-extras-tmp/Documentation\ncp -r ../../docs build/devel-extras-tmp/Documentation\n\n# copy the Xcode Project user templates\ncp -r \"../TemplatesForProjectBuilder\" build/devel-extras-tmp/\ncp -r \"../TemplatesForXcode\" build/devel-extras-tmp/\ncp \"pkg-support/Readme SDL Developer.txt\" build/devel-extras-tmp/\n\n# readme file\n#cp pkg-support/resources/ReadMe.txt build/devel-extras-tmp\n\n#cp pkg-support/resources/UniversalBinaryNotes.rtf build/devel-extras-tmp\n\n# Copy the devel-lite stuff just in case the user didn't notice it in the main package\n# I should copy all the different SDLMain versions (and nibs) instead.\n# I'm assuming the default is the same as the SDL App and SDL/OpenGL templates\n\ncp pkg-support/resources/ReadMeDevLite.txt build/devel-extras-tmp/SDLMain/NIBless\ncp ../../src/main/macosx/SDLMain.h build/devel-extras-tmp/SDLMain/NIBless\ncp ../../src/main/macosx/SDLMain.m build/devel-extras-tmp/SDLMain/NIBless\n\n# Nib stuff from SDL-Cocoa App\n/Developer/Tools/CpMac -r \"../TemplatesForXcode/SDL Cocoa Application/SDLMain.h\" build/devel-extras-tmp/SDLMain/CocoaMenus\n/Developer/Tools/CpMac -r \"../TemplatesForXcode/SDL Cocoa Application/SDLMain.m\" build/devel-extras-tmp/SDLMain/CocoaMenus\n/Developer/Tools/CpMac -r \"../TemplatesForXcode/SDL Cocoa Application/English.lproj/SDLMain.nib\" build/devel-extras-tmp/SDLMain/CocoaMenus\n\n# Nib stuff from SDL-Custom\ncp \"../TemplatesForXcode/SDL Custom Cocoa Application/MyController.h\" build/devel-extras-tmp/SDLMain/CustomView\ncp \"../TemplatesForXcode/SDL Custom Cocoa Application/MyController.m\" build/devel-extras-tmp/SDLMain/CustomView\ncp \"../TemplatesForXcode/SDL Custom Cocoa Application/MyCustomView.h\" build/devel-extras-tmp/SDLMain/CustomView\ncp \"../TemplatesForXcode/SDL Custom Cocoa Application/MyCustomView.m\" build/devel-extras-tmp/SDLMain/CustomView\ncp \"../TemplatesForXcode/SDL Custom Cocoa Application/MyCustomWindow.h\" build/devel-extras-tmp/SDLMain/CustomView\ncp \"../TemplatesForXcode/SDL Custom Cocoa Application/MyCustomWindow.m\" build/devel-extras-tmp/SDLMain/CustomView\ncp \"../TemplatesForXcode/SDL Custom Cocoa Application/SDLMain.h\" build/devel-extras-tmp/SDLMain/CustomView\ncp \"../TemplatesForXcode/SDL Custom Cocoa Application/SDLMain.m\" build/devel-extras-tmp/SDLMain/CustomView\n/Developer/Tools/CpMac -r \"../TemplatesForXcode/SDL Custom Cocoa Application/English.lproj/SDLMain.nib\" build/devel-extras-tmp/SDLMain/CustomView\n\n\n# Copy precompiled libSDLmain.a's here??? We have potentially 3 different ones?\n# /Developer/Tools/CpMac -r $TARGET_BUILD_DIR/libSDLmain.a build/devel-extras-tmp/SDLMain/NIBless\n#\n#\n\n# Copy sdl-config's for those who've been wanting one? Will need to document that it may\n# require manual changes if you don't install the framework to /Library/Frameworks\n# <<sdl-config here>>\n\n# remove the .DS_Store files if any (we may want to provide one in the future for fancy .dmgs)\nfind build/devel-extras-tmp -name .DS_Store -exec rm -f \"{}\" \\;\n# remove CVS stuff\nfind build/devel-extras-tmp -name .cvsignore -exec rm -f \"{}\" \\;\n# depth first traversal, type=directory, remove recursively\nfind -d build/devel-extras-tmp -type d -name CVS -exec rm -rf \"{}\" \\;\n\n\n# create the dmg\nhdiutil create -ov -fs HFS+ -volname SDL-devel-extras -srcfolder build/devel-extras-tmp build/SDL-devel-extras.dmg\n\n# clean up\nrm -rf build/devel-extras-tmp\n\n# compress it???\n#(cd build; gnutar -zcvf SDL.dmg.tar.gz SDL.dmg)\n\n";
